import { Container, Hero, Gradient, Content, PageTitle, SubTitle } from './PortfolioElements';
import Background from '../../Images/about-background.jpg';
import Skill from '../../Components/Project';
import ContactLink from '../../Components/ContactLink';

const Portfolio = () => {
    return (
        <Container>
            <Hero image={Background}>
                <Gradient>
                    <PageTitle>Portfolio</PageTitle>
                    <SubTitle>Projects I have worked on</SubTitle>
                </Gradient>
            </Hero>
            <Content>
                <ContactLink />
            </Content>
        </Container>
    );
}

export default Portfolio;
